import React from "react";
import Python from "../images/python.jpeg";
import C from "../images/c++.png";
import Htm from "../images/html.png";
import Css from "../images/css.png";
import Bootstrap from "../images/bootstrap.png";
import Js from "../images/js.png";
import Rea from "../images/react.png";
import Tailwind from "../images/tailwind.jpg";
import MongoDb from "../images/mongodb.webp";
import Njs from "../images/njs.png";
import Firebase from "../images/firebase.webp";

const main = () => {
  return (
    <div className=" h-400 bg-white ">
      <div className="flex justify-center">
        <h1 className="text-4xl py-8 font-bold">SKILLS</h1>
      </div>
      <div className="flex flex-col justify-center md:flex-row">
        <div className="flex justify-evenly">
          <div className=" w-1/2 flex flex-col justify-center items-center">
          <img className="w-20 rounded-3xl" src={Python} alt="" /> <span className="font-bold text-2xl uppercase py-8"> Python</span>
          </div>
          <div className=" w-1/2 flex flex-col justify-center items-center">
          <img className="w-20 rounded-3xl" src={C} alt="" /> <span className="font-bold text-2xl uppercase py-8">C++</span>
          </div>
          <div className=" w-1/2 flex flex-col justify-center items-center">
          <img className="w-20 rounded-3xl" src={Js} alt="" /> <span className="font-bold text-2xl uppercase py-8">Javascript</span>
          </div>
          <div className=" w-1/2 flex flex-col justify-center items-center">
          <img className="w-20 rounded-3xl" src={Htm} alt="" /> <span className="font-bold text-2xl uppercase py-8">Html</span>
          </div>
          <div className=" w-1/2 flex flex-col justify-center items-center" >
          <img className="w-20 rounded-3xl" src={Css} alt="" /> <span className="font-bold text-2xl uppercase py-8">Css</span>
          </div>
        </div>
        <div className="flex justify-evenly mt-28">
        <div className=" w-1/2 flex flex-col justify-center items-center">
          <img className="w-20 rounded-3xl" src={Rea} alt="" /><span className="font-bold text-2xl uppercase py-8">React</span>
          </div>
          <div className=" w-1/2 flex flex-col justify-center items-center">
          <img className="w-24 rounded-3xl" src={Bootstrap} alt="" /><span className="font-bold text-2xl uppercase py-8">Bootstrap</span>
          </div>
          <div className=" w-1/2 flex flex-col justify-center items-center">
          <img className="w-36 rounded-3xl" src={Njs} alt="" /><span className="font-bold text-2xl uppercase py-8">NodeJS</span>
          </div>
          <div className=" w-1/2 flex flex-col justify-center items-center">
          <img className="w-36 rounded-3xl" src={MongoDb} alt="" /><span className="font-bold text-2xl uppercase py-8">Mongo db</span>
          </div>
          <div className="flex flex-col justify-center items-center">
          <img className="w-36 rounded-3xl" src={Firebase} alt="" /><span className="font-bold text-2xl uppercase py-8">Firebase</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default main;
